class Queue{

private:
int front;
int rear;
int maxSize;
int newQueue[100];

public:

Queue(int size){
front=-1;
top=-1;

maxSize=size;


} 

bool isEmpty(){
if(front==-1&& rear==-1){

return 1;

}
else if(front==rear){

front=-1;
rear=-1;

}
else{
return 0;

}





}

bool isFull(){
if(rear==maxSize-1){
return 1;

}

else{
return 0;

}


}


void Enqueue(int digit){
if(isFull()){

cout<<"Queue is Full"<<endl;

}
else{
newQueue[rear+1]=digit;
++rear;

}

}

void Dequeue(){
if(isEmpty()){
cout<<"Queue is Empty"<<endl;

}
else{
cout<<"Current dequeue element is: "<<newQueue[front+1]<<endl;
++front;
}

}


};

